import React from 'react';

import { SearchBarInput } from './search-bar.styles';

const handleChange = (e) => {
  console.log("Look : ", e.value)
}

const SearchBar = ({ setEmptyInput }) => {
  return (
    <SearchBarInput
      onChange={handleChange}
    />
  )
}

export default SearchBar;
